{"comparray":{"scriptActive":true,"script":"var competitors = fd_data.flow_var.competitors

if (competitors) {
 // Split the competitors string into an array of sys_ids
 var racers =[];
 racers = competitors.split(',');
 // Shuffle the racers array randomly
 for (let i = racers.length - 1; i > 0; i--) {
 const j = Math.floor(Math.random() * (i + 1));
 [racers[i], racers[j]] = [racers[j], racers[i]];
 }

 // Pair racers sequentially
 const reorderedRacers = [];
 for (let i = 0; i < racers.length; i += 2) {
 reorderedRacers.push([racers[i], racers[i + 1]]);
 }

 return JSON.stringify(reorderedRacers);
